eval("\nif (false) {}\n\nvar requireMap = { 'react': __webpack_require__(/*! react */ \"./node_modules/react/index.js\") };\nvar requireInRuntimeBase = __webpack_require__(/*! ./node_modules/react-styleguidist/loaders/utils/client/requireInRuntime */ \"./node_modules/react-styleguidist/loaders/utils/client/requireInRuntime.js\");\nvar requireInRuntime = requireInRuntimeBase.bind(null, requireMap);\nvar evalInContextBase = __webpack_require__(/*! ./node_modules/react-styleguidist/loaders/utils/client/evalInContext */ \"./node_modules/react-styleguidist/loaders/utils/client/evalInContext.js\");\nvar evalInContext = evalInContextBase.bind(null, \"var React = require('react');\", requireInRuntime);\n\nmodule.exports = [{\n        'type': 'markdown',\n        'content': 'A great way for styling layouts in a React environment\\n\\nAll components dealing with layouts should have their own className just like any other component. The main thing about building components that are dealing with layout is trying to keep the styling grouped in that component so you don\\'t have to dig down into other components to see what the rest of the styling is. Another thing to keep in mind is when building components, there may be some common styling shared across the SPA. Think globally when you start building something that has to do with the styling of layouts. If you see something that may be shared across pages, check with the UX designer to see if that\\'s the case and build a generic component to handle this. A good example of this would be the [`<Section />`](/#!/Section) and [`<SectionHeader />`](/#!/SectionHeader) components where there\\'s a globally styled header for each section. The section could also potentially have some global styling for the padding or margins between each section depending on where they are in the layout and if that styling could be shared globally.\\n\\n## Flexbox Example\\n\\nBest example would be using something like the css flexbox. So let\\'s say you had a parent component that had three components as its children that need to be part of the flex layout. Instead of having the parent having the styling for `display: flex` and each child\\'s scss file having its own styling for something like `flex: 1 0 auto`, you would want to pass a className from the parent to the child and have all the styling in the parent.\\n\\n### ParentFlex component\\n\\n```html\\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"parent-flex\"</span>&gt;</span>\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">FirstChild</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"parent-flex--first-child\"</span> /&gt;</span> // generally add something similar to the component name at the end\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">SecondChild</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"parent-flex--second-child\"</span> /&gt;</span>\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">SecondChild</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"parent-flex--third-child\"</span> /&gt;</span>\\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n```\\n\\nThis way you can group all the styling related to the flexbox in one file instead of having to look at four different scss files to accomplish the styling, like so:\\n\\n```scss\\n<span class=\"hljs-selector-class\">.parent-flex</span> {\\n    <span class=\"hljs-attribute\">align-content</span>: stretch;\\n    <span class=\"hljs-attribute\">display</span>: flex;\\n    <span class=\"hljs-attribute\">flex-direction</span>: row;\\n\\n    &amp;--first-child {\\n        <span class=\"hljs-attribute\">flex</span>: <span class=\"hljs-number\">0</span> <span class=\"hljs-number\">0</span> <span class=\"hljs-number\">100px</span>; <span class=\"hljs-comment\">// keeps this fixed width at 100px</span>\\n    }\\n\\n    &amp;--second-child {\\n        <span class=\"hljs-attribute\">flex</span>: <span class=\"hljs-number\">2</span> <span class=\"hljs-number\">0</span> auto; <span class=\"hljs-comment\">// allows to grow and take up more space than third-child</span>\\n    }\\n\\n    &amp;--third-child {\\n        <span class=\"hljs-attribute\">flex</span>: <span class=\"hljs-number\">1</span> <span class=\"hljs-number\">0</span> auto; <span class=\"hljs-comment\">// allows to grow and take up less space than second-child</span>\\n    }\\n}\\n```\\n\\nThe components would look something like...\\n\\n### FirstChild component\\n\\n```jsx\\n<span class=\"hljs-comment\">//...other necessary importing goes here</span>\\n<span class=\"hljs-keyword\">import</span> classnames <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">\\'classnames\\'</span>;\\n\\n<span class=\"hljs-comment\">// you would only have a style sheet for this component if you had to do additional styling with it\\'s layout.</span>\\n\\n<span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">FirstChild</span> <span class=\"hljs-keyword\">extends</span> <span class=\"hljs-title\">Component</span> </span>{\\n    getClass() {\\n        <span class=\"hljs-keyword\">return</span> classnames(<span class=\"hljs-string\">\\'first-child\\'</span>, <span class=\"hljs-keyword\">this</span>.props.className)\\n    }\\n\\n    render() {\\n        <span class=\"hljs-keyword\">return</span> <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">{this.getClass()}</span>&gt;</span>first child<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span></span>\\n    }\\n}\\n\\n<span class=\"hljs-comment\">//...etc</span>\\n```\\n\\nYou would repeat the same getClass type of functionality for the SecondChild and ThirdChild components.\\n\\n## Position Absolute Example\\n\\nThe same type of pattern would also go for dealing with components that need `position: absolute` within a parent component. When using `position: absolute` be sure you set its parent to `position: relative`; otherwise, a good deal of goofiness can start happening when you\\'re trying to style around that or change the viewport size of the window.\\n\\n### ParentRelative component\\n\\n```html\\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"parent-relative\"</span>&gt;</span>\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">FirstChild</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"parent-relative--first-child\"</span> /&gt;</span> // generally add something similar to the component name at the end\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">SecondChild</span> /&gt;</span>\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">SecondChild</span> /&gt;</span>\\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n```\\n\\n```scss\\n<span class=\"hljs-selector-class\">.parent-relative</span> {\\n    <span class=\"hljs-attribute\">position</span>: relative; <span class=\"hljs-comment\">// be sure to set the parent of absolute children to relative</span>\\n\\n    &amp;--first-child {\\n        <span class=\"hljs-attribute\">position</span>: absolute;\\n        <span class=\"hljs-attribute\">top</span>: <span class=\"hljs-number\">20px</span>;\\n        <span class=\"hljs-attribute\">left</span>: <span class=\"hljs-number\">20px</span>;\\n    }\\n}\\n```\\n\\n### FirstChild component\\n\\n```jsx\\n<span class=\"hljs-comment\">//...other necessary importing goes here</span>\\n<span class=\"hljs-keyword\">import</span> classnames <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">\\'classnames\\'</span>;\\n\\n<span class=\"hljs-comment\">// you would only have a style sheet for this component if you had to do additional styling with it\\'s layout.</span>\\n\\n<span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">FirstChild</span> <span class=\"hljs-keyword\">extends</span> <span class=\"hljs-title\">Component</span> </span>{\\n    getClass() {\\n        <span class=\"hljs-keyword\">return</span> classnames(<span class=\"hljs-string\">\\'first-child\\'</span>, <span class=\"hljs-keyword\">this</span>.props.className)\\n    }\\n\\n    render() {\\n        <span class=\"hljs-keyword\">return</span> <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">{this.getClass()}</span>&gt;</span>first child<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span></span>\\n    }\\n}\\n\\n<span class=\"hljs-comment\">//...etc</span>\\n```\\n\\nThe SecondChild and ThirdChild components would not need the getClass functionality since you\\'re not passing any className props into them.\\n\\n## Avoid Floats\\n\\nAt almost all costs avoid using `float: left` or `float: right`. Both of these pose potential problems and generally require extra styling or DOM elements which are not necessary. A couple of alternatives are making your elements `display: inline-block` or using `position: absolute`. Generally you won\\'t need to use the absolute positioning unless it\\'s something that needs to be at the right side, but even then the inline-block method can be used.\\n\\n### Using Inline Blocks\\n\\nThe following would mimic floating elements to the left without using float.\\n\\n```scss\\n<span class=\"hljs-selector-class\">.main</span> {\\n\\n    &amp;--child {\\n        <span class=\"hljs-attribute\">display</span>: inline-block;\\n    }\\n}\\n```\\n\\n```html\\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"main\"</span>&gt;</span>\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"main--child\"</span>&gt;</span>Child 1<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"main--child\"</span>&gt;</span>Child 2<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"main--child\"</span>&gt;</span>Child 3<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n```\\n\\nThe following would mimic floating elements to the right without using float.\\n\\n```scss\\n<span class=\"hljs-selector-class\">.main</span> {\\n    <span class=\"hljs-attribute\">text-align</span>: right;\\n\\n    &amp;--child {\\n        <span class=\"hljs-attribute\">display</span>: inline-block;\\n    }\\n}\\n```\\n\\n```html\\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"main\"</span>&gt;</span>\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"main--child\"</span>&gt;</span>Child 1<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"main--child\"</span>&gt;</span>Child 2<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">\"main--child\"</span>&gt;</span>Child 3<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n```\\n\\n### Using Absolute Positioning\\n\\nLet\\'s say you had an element on the left side and wanted to have elements on the right side on the same line.\\n\\n```scss\\n<span class=\"hljs-selector-class\">.main</span> {\\n    <span class=\"hljs-attribute\">position</span>: relative; <span class=\"hljs-comment\">// remember to make the parent relative for the child that\\'s absolute</span>\\n\\n    &amp;--<span class=\"hljs-attribute\">right</span> {\\n        <span class=\"hljs-attribute\">position</span>: absolute;\\n        <span class=\"hljs-attribute\">right</span>: <span class=\"hljs-number\">0</span>;\\n        <span class=\"hljs-attribute\">top</span>: <span class=\"hljs-number\">0</span>; <span class=\"hljs-comment\">// generally need to set a position for the top so everything aligns</span>\\n\\n        &amp;-child {\\n            <span class=\"hljs-attribute\">display</span>: inline-block;\\n        }\\n    }\\n}\\n```\\n\\n```html\\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"main\"</span>&gt;</span>\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"main--left\"</span>&gt;</span>I\\'m on the left<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"main--right\"</span>&gt;</span>\\n        <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"main--right-child\"</span>&gt;</span>\\n            Child 1\\n        <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n        <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"main--right-child\"</span>&gt;</span>\\n            Child 2\\n        <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n        <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"main--right-child\"</span>&gt;</span>\\n            Child 3\\n        <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n    <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\\n```'\n    }]\n\t\n\n//# sourceURL=webpack:///./styleguidist-docs/StylingLayouts.md?./node_modules/react-styleguidist/loaders/examples-loader.js");

